import React, { Fragment }from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { Provider } from 'react-redux'
import store from './store/Store'

ReactDOM.render(
  <Fragment>
    <Provider store={store}>
      <App />
    </Provider>,
    document.getElementById('root')
    </Fragment>
);
